Huans organizē savas kolekcijas zīmogus pēc valsts un desmitgades, kurā tie tika izdoti. Cenas, ko viņš par tiem samaksāja zīmogu veikalā, bija: Brazīlija un Francija, $6$ centi katrs, Peru $4$ centi katrs, un Spānija $5$ centi katrs. (Brazīlija un Peru ir Dienvidamerikas valstis, bet Francija un Spānija ir Eiropā.) [asy]
/* AMC8 2002 #8, 9, 10 Problem */
size(3inch, 1.5inch);
for ( int y = 0; y <= 5; ++y )
{

